sources.headersFooters\\footerFirst\\footerfirst:
.headersFooters__footerFirst {
    width: 100%;
    height: 372px;
    background-color: white;
    font-size: 6px;
    font-family: $fontStack-light;
    line-height: 20px;
    color: $darkShade75;
    text-align: left;
    display: flex;
    justify-content: center;
}
.elemFirstFooter {
    display: flexbox;
    width: 16%;
    height: 172px;
    margin: auto;
    margin-right: 0px;
    margin-left: 0px;
}
.headersFooters__footerFirst_logo_text {
    margin-top: 20px;
}
.headText {
    font-family: $fontStack-bold;
    font-size: 15px;
    font-weight: bolder;
    color: black;
}
.headersFooters__footerFirst_nav {
    width: 10%;
    margin-left: 40px;
}
.headersFooters__footerFirst_aboutUs {
    width: 9%;
    margin-left: 40px;
}
.headersFooters__footerFirst_support {
    width: 15%;
    margin-left: 40px;
}
.headersFooters__footerFirst_subscribe {
    width: 16%;
}
.headersFooters__footerFirst_subscribe_mailBox {
    width: 19%;
    display: flex;
}
.headersFooters__footerFirst_subscribe_mailBox_mail {
    width: 90em;
    height: 34px;
    border: 1px solid $darkShade75;;
    border-right: none;
    border-top-left-radius: 4px;
    border-bottom-left-radius: 4px;
    display: flexbox;
}
.headersFooters__footerFirst_subscribe_mailBox_push {
    width: 30em;
    height: 38px;
    border: 1px solid $darkShade75;
    border-left: none;
    border-top-right-radius: 4px;
    border-bottom-right-radius: 4px;
    display: flexbox;
    background-color: white;
    background-image: url(assets/image/arrow_forward.png);
    background-repeat: no-repeat;
    background-position: center;
}
.headersFooters__footerFirst_subscribe_mailBox_push:hover {
    background-color: rgb(206, 205, 205);
    background-image: url(assets/image/arrow_forward_black.png);
    cursor: pointer;
}
.hover:hover {
    color: black;
    cursor: pointer;
}
.headersFooters__footerFirst_down {
    width: 100%;
    height: 70px;
    background-color: white;
    font-size: 6px;
    font-family: $fontStack-light;
    line-height: 20px;
    color: $darkShade75;
}
.headersFooters__footerFirst_down_text {
    margin-left: 10%;
    margin-top: 25px;
    height: 20px;
    display: inline-block;
}
.headersFooters__footerFirst_down_icons {
    width: 9%;
    height: 24px;
    display: inline-flex;
    margin-left: 40%;
}
.icons {
    display: flexbox;
    margin: auto;
}
.icons:hover {
    background-color: rgb(219, 219, 219);
    cursor: pointer;
    border-radius: 5px;
}
.margin-footerFirst-down {
    margin-top: 1px;
}

